import React from 'react';
import '../App.css';
import { Button } from './Button';
import './InfoSection.css';
//import { Text, StyleSheet } from 'react-native';

function InfoSection() {
  return (
    <div className='info-container'>
      <h0>Howdy! We are Korean-American Scientists and Engineers Association (KSEA) at Texas A&M University. </h0>
      <p0>KSEA was established in 1971 as a non-profit professional organization and has grown to over 6,000 registered members with ~70 Local Chapter and Branches, ~30 Affiliated Professional Societies, and 13 Technical Groups across the United States.</p0>

      {<h1>Mission</h1>}
      <h2>In the areas of science, technology and entrepreneurship, we provide opportunities for:</h2>

      <div className='flexbox-container'>
        <div className='flexbox-item flexbox-item1'>
            <img src = '/images/globe2.svg' style = {{width : '40px', height : '40px', borderRadius : '5px', marginBottom : '5px'}} class="rounded mx-auto d-block" />    
            <h3>International</h3>
            <h3>Cooperation</h3>
            {/*<p3>At eripuit signiferumque sea, vel ad mucius molestie, cu labitur iuvaret vulputate sed.</p3>*/}
        </div>
        <div className='flexbox-item flexbox-item2'>
            <img src = '/images/reception-4.svg' style = {{width : '40px', height : '40px', borderRadius : '5px', marginBottom : '5px'}} class="rounded mx-auto d-block"/>
            <h3>Career</h3>
            <h3>Development</h3>
        </div>
        <div className='flexbox-item flexbox-item3'>
            <img src = '/images/people.svg' style = {{width : '40px', height : '40px', borderRadius : '5px', marginBottom : '5px'}} class="rounded mx-auto d-block"/>
            <h3>Community</h3>
            <h3>Service</h3>
        </div>
        {/* <div className='axis main-axis'></div>
        <div className='axis cross-axis'></div> */}
      </div>

      <div className='flexbox-container2'>
        <div className='flexbox2-item flexbox-item1'>
        <img src = '/images/signpost.svg' style = {{width : '150px', height : '150px', borderRadius : '5px'}} />
        </div>

        <div className='flexbox2-item flexbox-item2'>
        <h4>Vision</h4>
        <p4>The organization holds following objectives</p4>
        <ul style="list-style-type:square">

<li>First Item</li>

<li>Second Item</li>

<li>Third Item</li>

</ul>

        <p4><br></br>1. Promote the application of science and technology for the general welfare of society<br></br>2. Foster international cooperation especially between the U.S. and Korea<br></br>3. Help Korean-American Scientists and Engineers develop their full career potential</p4>

        </div>
      </div>
    </div>
  );
}

export default InfoSection;

